import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Account from './pages/account.js';
import Calculate from './pages/calculator.js';
im


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Account} />
        <Route exact path="/about" component={Calculate} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
